measurements.description:
Thirty-eight flowers and 13 buds on five arched up to 77.5-cm inflorescences; 

 sepals and petals broadly acuminate, bronze-orange, darker veins;

 lip cream, keels yellow speckled maroon, side lobes flushed bronze-orange, midlobe blotched dark maroon; 

 column cream flushed bronze ventrally, anther cap white;
 substance firm; texture matte.
